import React from 'react';
import { AiFillDelete,AiFillHome} from 'react-icons/fa'

const Sidebar = () => {
    const sideBaritems = [
        {
            path:"/Home",
            name:"home",
            icon:<AiFillHome/>
        },
        {
            path:"/Project_Status",
            name:"projectstatus",
            
        },
        {
            path:"/Update_Employee",
            name:"updateEmp",
            
        },
        {
            path:"/Remove_Employee",
            name:"removeEmp",
            icon:<AiFillDelete/>
        },
    ]
  return(
    <div>
      <h1>Sidebar</h1>
    </div>
  )
}

export default Sidebar;
